import React from 'react';
import { Switch, Route } from 'react-router-dom';

import ButtonLink from '../../UserInterface/Buttons/ButtonLink';
import LevelBlock_1 from './LevelBlock';

function SelectingLevelBlock(props) {


    const hendlerSelectLevelBlock = () => {

    }

    return (

        <div>

            <Switch>
                {
                    props.namesLevelBlock.map((nameLevel, index) => {
                        return <Route
                            path="/LevelBlock_1"
                            key={index + 'route'}
                            component={LevelBlock_1}
                        />
                    })
                }
            </Switch>

            {
                props.namesLevelBlock.map((nameLevel, index) => {
                    return <ButtonLink
                        to={"/LevelBlock_1"}
                                classname=''
                                onclick={hendlerSelectLevelBlock}
                                name={index + 1}
                                key={index}
                            />
                })
            }
                
                
            </div>
        
     )
}

export default SelectingLevelBlock
